import React from "react";

type AccordionType = {
    title:string
    changeCollapsed:(collapsed:boolean)=>void
    collapsed:boolean
}

export function Accordion (props:AccordionType){




    const ChangeCollapsed =(collapsed:boolean)=> {
       props.changeCollapsed(!collapsed)
    }

    return (<div>
        <AccordionTitle title={props.title} onClick={()=>ChangeCollapsed(props.collapsed)}/>


        {props.collapsed &&<AccordionBody />}


    </div>)


}

type AccordionTitle = {
    title:string;
    onClick:()=>void

}

export function AccordionTitle (props:AccordionTitle){
    return (
        <div>
            <h3 onClick={(index)=>props.onClick(index)}>---{props.title}---</h3>


        </div>
    )
}

export function AccordionBody (props:any){
    return (
        <div>

            <ul>
                <li>1</li>
                <li>2</li>
                <li>3</li>
            </ul>

        </div>
    )
}
